for qb in ['Q4J1','Q5J1','Q4J2','Q5J2']:
    biases=[]
    parity_rate=[]
    for i in range(len(parity_rate_data[qb])):
        if parity_rate_data[qb][i] < 5000 and parity_rate_data[qb][i] > 50:
            if qb[3]=='1':
                biases.append(biases_data[qb][i])
            else:
                biases.append(1.2*biases_data[qb][i])
            if qb[1]=='4':
                mrk = 's'
                lbl = 'Antenna'
            else:
                mrk = 'o'
                lbl = 'Reference'
            parity_rate.append(parity_rate_data[qb][i])
    plt.title('Parity Rate vs Radiator Bias')
    # plt.plot(4*times, np.abs(I + Q * 1j))
    plt.semilogy([np.abs(b) for b in biases], parity_rate,marker=mrk,color=next(color),linestyle='None',label=lbl)

    plt.grid(which='both')
    # plt.ylim(0.4e3,8e3)
    plt.xlim(0,0.12)
    plt.legend()
    # plt.xlabel('Radiator Bias (mV)')
    plt.xlabel('Radiator Bias (arb. units.)')
    plt.ylabel('Parity Rate (Hz)')
    plt.pause(0.1)

